"vs/workbench/parts/codeEditor/electron-browser/accessibility":['Se cambiará ahora el valor de configuración "editor.accessibilitySupport" a "activado".',"Se abrirá ahora la página de documentación de accesibilidad de VS Code.","Gracias por probar las opciones de accesibilidad de VS Code.","Estado:","Para configurar el editor de forma que esté optimizado de permanentemente para su uso con un lector de pantalla, presione ahora Comando+E.","Para configurar el editor de forma que esté optimizado permanentemente para su uso con un lector de pantalla, presione ahora Control+E.","El editor está configurado para usar API de plataforma para detectar cuándo está conectado un lector de pantalla, pero el entorno actual de tiempo de ejecución no admite esta característica.","El editor ha detectado automáticamente un lector de pantalla conectado.","El editor está configurado para detectar automáticamente cuándo está conectado un lector de pantalla, lo que no es el caso en este momento.",'El editor está configurado para optimizarse permanentemente para su uso con un lector de pantalla; para cambiar este comportamiento, edite el valor de configuración "editor.accessibilitySupport".',"El editor está configurado de forma que no esté nunca optimizado para su uso con un lector de pantalla.","Al presionar TAB en el editor actual, el foco se mueve al siguiente elemento activable. Presione {0} para activar o desactivar este comportamiento.","Al presionar TAB en el editor actual, el foco se mueve al siguiente elemento activable. El comando {0} no se puede desencadenar actualmente mediante un enlace de teclado.","Al presionar TAB en el editor actual, se insertará el carácter de tabulación. Presione {0} para activar o desactivar este comportamiento.","Al presionar TAB en el editor actual, se insertará el carácter de tabulación. El comando {0} no se puede desencadenar actualmente mediante un enlace de teclado.","Presione Comando+H ahora para abrir una ventana de explorador con más información de VS Code relacionada con la accesibilidad.","Presione Control+H ahora para abrir una ventana de explorador con más información de VS Code relacionada con la accesibilidad.","Para descartar esta información sobre herramientas y volver al editor, presione Esc o Mayús+Escape.","Mostrar ayuda de accesibilidad"],
