"vs/workbench/parts/codeEditor/electron-browser/languageConfiguration/languageConfigurationExtensionPoint":["Errores al analizar {0}: {1}","Secuencia de cadena o corchete de apertura.","Secuencia de cadena o corchete de cierre.","Define los símbolos de comentario","Define cómo se marcan los comentarios de bloque.","Secuencia de caracteres que inicia un comentario de bloque.","Secuencia de caracteres que finaliza un comentario de bloque.","Secuencia de caracteres que inicia un comentario de línea.","Define los corchetes que aumentan o reducen la sangría.","Define el par de corchetes. Cuando se escribe un corchete de apertura, se inserta automáticamente el corchete de cierre.","Define una lista de ámbitos donde los pares automáticos están deshabilitados.","Define los pares de corchetes que se pueden usar para encerrar una cadena seleccionada."," La definición de la palabra en el idioma.","El patrón de expresión regular utilizado para localizar palabras.","Los flags de expresión regular utilizados para localizar palabras.","Debe coincidir con el patrón `/^([gimuy]+)$/`.","Configuración de sangría del idioma.","Si una línea coincide con este patrón, todas las líneas después de ella deben sangrarse una vez (hasta que otra regla coincida). ","El patrón de RegExp para increaseIndentPattern.","Las marcas de RegExp para increaseIndentPattern.","Debe coincidir con el patrón `/^([gimuy]+)$/`.","Si una línea coincide con este patrón, se deben quitar la sangría de todas las líneas después de ella una vez (hasta que otra regla coincida).","El patrón de RegExp para decreaseIndentPattern.","Las marcas de RegExp para decreaseIndentPattern.","Debe coincidir con el patrón `/^([gimuy]+)$/`.","Si una línea coincide con este patrón **solo la línea siguiente** después de ella se debe sangrar una vez.","El patrón de RegExp para indentNextLinePattern.","El patrón de RegExp para indentNextLinePattern.","Debe coincidir con el patrón `/^([gimuy]+)$/`.","Si una línea coincide con este patrón, su sangría no se debe cambiar y no se debe evaluar utilizando las otras reglas.","El patrón de RegExp para unIndentedLinePattern.","Las marcas de RegExp para unIndentedLinePattern.","Debe coincidir con el patrón `/^([gimuy]+)$/`.","Configuración del plegamiento de idioma.","Un idioma se adhiere a la regla del fuera de juego si los bloques en ese idioma se expresan por su sangría. Si se establece, las líneas vacías pertenecen al bloque posterior.",'Marcadores de plegado específicos de un idioma, como "\'#region" o "#endregion". Se probarán los valores regex en relación con el contenido de todas las líneas, y deben estar diseñados de manera eficiente.',"El patrón de expresión regular para el marcador de inicio. La expresión regular debe comenzar con '^'.","El patrón de expresión regular para el marcador de fin. La expresión regular debe comenzar con '^'."],
